import React from 'react';

// promise : 
//     resolve 
//     reject
//     pending


function myFun() {
    return new Promise(function (resolve, reject) {
        setTimeout(() => {
            const error = true;
            if (!error) {
                console.log("promise resolved")
                resolve();
            }
            else
                console.log("not resolved");
            reject('sorry')
        }, 2000)
    })
}

myFun()

export default Promise
